import React, { useEffect, useState } from "react";
import { getTeams } from "../../api/api";
export default function Teams() {
  const [teams, setTeams] = useState({});
  useEffect(() => {
    getTeams()
      .then(res => {
        return res.json();
      })
      .then(data => {
        setTeams(data);
      })
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <ul>
        {teams.map(team => {
          return <li>{team}</li>;
        })}
      </ul>
    </div>
  );
}
